import { Link } from "react-router-dom";
import { useContextGlobal } from "./utils/ContextGlobal";
import { initialState } from './utils/global.context';

//Este componente debera ser estilado como "dark" o "light" dependiendo del theme del Context

const Navbar = () => {
  const {theme, changeTheme} = useGlobalStateS()
  const clase = `${theme.navdark} ${theme.background}`
  console.log(theme)
  return (
    <nav className={clase}>
      <div className='flex-dh'>
        <span className='rojo'>D</span> <p className='p_nav'>Dentist</p>
      <Link to={"/Home"}>Home</Link> 
      <Link to={"/contact"}>Contact</Link> 
      <Link to={"/favs"}>Favs</Link> 
      {/* Aqui deberan agregar los links correspondientes a las rutas definidas */}
      {/* Deberan implementar ademas la logica para cambiar de Theme con el button */}
      <button className='darkmode' id={theme.buttonmode} onClick={changeTheme}>{theme.buttonmode ? 'LIGHT' : 'DARK'}</button>
      </div >
    </nav>
  )
}

export default Navbar
